import React from "react";

const Liked = ({ likedItems }) => {
  return (
    <main className="liked-page">
      <div className="liked-page-heading">
        <h1 className="liked-page-h1">Liked Pieces</h1>
        <p className="liked-page-p">
          Save art from the gallery in your liked page.
        </p>
      </div>
      <div className="liked-page-container">
        {likedItems.map((item) => (
          <div className="liked-page-item" key={item.id}>
            <img src={item.image} alt={item.title} />
            <p>{item.title}</p>
          </div>
        ))}
      </div>
    </main>
  );
};

export default Liked;
